const distance = (e, t, r, a) => Math.sqrt((r - e) ** 2 - (a - t) ** 2);
var movement = {
  name: "movement",
  version: "v1.0.0",
  requires: [],
  optionalRequires: [],
  optFuncs: {},
  description: "Adds support for moving elements to mattex.",
  funcs: {
    async m_rect(e, t, r, a, n, o, s, i, c, m, u) {
      for (
        var d = Math.round((r - e) / m),
          v = Math.round((a - t) / m),
          h = c / m,
          p = 0;
        p < m;
        p++
      )
        u(p), this.rect(e + d * p, t + v * p, n, o, s, i), await sleep(h);
    },
    async m_circle(e, t, r, a, n, o, s, i, c, m) {
      for (
        var u = Math.round((r - e) / c),
          d = Math.round((a - t) / c),
          v = i / c,
          h = 0;
        h < c;
        h++
      )
        m(h), this.circle(e + u * h, t + d * h, n, o, s), await sleep(v);
    },
  },
};
